import './App.css';
import { BrowserRouter, Routes, Route, Navigate, useLocation } from 'react-router-dom';
import Home from './components/home'


function App() {
  return (
    <div className="wrapper">
      <h1>Application</h1>
      <BrowserRouter>
        <Routes>
            <Route path="/home"  element={Home} />

        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
